import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";
import "./items.css";

export default function Items() {
  const { itemID } = useParams();

  const [itemInfo, setItemInfo] = useState({
    id: "null",
    itemName: "null",
    itemPrice: "null",
    description: "null",
    category: "null",
    postTime: "null",
    editTime: "null",
    visitCount: "null",
    searchCount: "null",
    photo1Name: "null",
    photo2Name: "null",
    photo3Name: "null",
    status: "null",
  });

  useEffect(() => {
    axios
      .get(`http://localhost:8000/items/${itemID}`)
      .then((res) => {
        if (res.data !== "empty") {
          setItemInfo(res.data[0]);
          console.log(res.data[0]);
        }
      })
      .catch((err) => {
        console.error(err);
      });
  }, [itemID]);

  return (
    <div>
      <div>Items of {JSON.stringify(itemInfo)}</div>

      <div className="itemContainer">
        <div className="itemPhotoContainer">
          <img
            className="itemPhoto"
            src="http://localhost:8000/photos/itemid18photo1.png"
            alt=""
          />
        </div>
        <div className="itemInfoBox">
          <div className="itemInfoName">iphone 13 pro max</div>
          <div className="itemInfoPrice">iphone 13 pro max</div>
          <div className="itemInfoPostTime">iphone 13 pro max</div>
          <div className="itemInfoEditTime">iphone 13 pro max</div>
          <h1>testing2</h1>
          <h1>testing2</h1>
        </div>
      </div>

      <div className="itemDescriptionContainer">
        <h1>testing</h1>
        <div>testing</div>
      </div>
    </div>
  );
}

